window.bookSummaryJSON = "<p><b>Pain is a currency the residents of Raleigh are rich in. </b></p> <p>For Silver Parisi, life should be simpler than ever now that Jacob Weaving is behind bars. However, corruption runs deep within Raleigh's town limits, and in the end, power and money will turn even those sworn to serve and protect.&nbsp;</p> <p>Alex Moretti's never had anything to lose. Kicked from foster home to foster home, beaten, broken and abandoned, he's used to fighting for his own survival. The brutal challenges he's had to face have hardened him and made him a savage force to be reckoned with.&nbsp;</p> <p>But even the strongest amongst us have a breaking point....</p> <p><i>This is the third and final installment in the best-selling Raleigh Rebels series, by </i>USA Today<i> best-selling author Callie Hart.</i></p>"; 
